style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("veteranstoday.com")

{

/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, li, ul, h1, h2, h3, h4, h5, h6, font, strong, p, form, footer

{
color: white !important;
background: black !important;
}

select, button, #sidebarTabs_title li a, #primaryBottomTabs_title li a

{
background: black !important;
}

div, span, a

{
background-color: black !important;
}

legend, select, input, span, code, textarea, pre, label, div, dd

{
color: white !important;
}

blockquote

{
border: 1px black !important;
}


/*links*/

a

{
color: #0040ff !important;
}

a:visited

{
color: #224375 !important;
}

/*highlight*/

textarea, pre, input, code, #sidebarTabs_title li a:hover, #primaryBottomTabs_title li a:hover

{
background: #333333 !important;
}

}
